import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [videos, setVideos] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/getvideos').then((response) => {
      setVideos(response.data);
      console.log(response.data)
    })
  }, [])

  return (
    <div className='App'>
      {videos.map((val, key) => {
        return <div>
          <h1>{val.title}</h1>
        </div>
      })}
    </div>
  )
}  
export default App;
